INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (5, 'PRE001', 'Land is altijd gevuld; deze mag gevuld zijn met de standaardwaarde 0000. Het moet een land zijn dat voorkomt in de GBA landentabel.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (6, 'PRE002', 'Als het land Nederland is, dan moet de Plaats een gemeentecode bevatten. Het moet een gemeente zijn die voorkomt in de GBA gemeentetabel. Er mag geen andere dan wel extra informatie in Plaats staan.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (7, 'PRE003', 'Als Gemeente ingevuld is, dan moet het land Nederland zijn.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (8, 'PRE004', 'Als Buitenlandse plaats eventueel in combinatie met Buitenlandse regio ingevuld is, dan is het land niet Nederland.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (9, 'PRE005', 'In iedere Persoon categorie (categorie 01 dan wel historische categorie 51) is het element 01.10 gevuld.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (10, 'PRE006', 'In het element Voornamen kunnen meerdere namen achter elkaar opgesomd worden. De scheiding tussen namen wordt altijd (en alleen) weergegeven door middel van minstens één spatie.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (11, 'PRE007', 'Als er geboortegegevens zijn, dan moeten in ieder geval het geboorteland en de geboortedatum opgenomen zijn. (dit mogen zogenaamde standaardwaarden zijn)', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (12, 'PRE008', 'Preconditie PRE001, specifiek voor de LO3-groep 03 Geboorte.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (13, 'PRE009', 'Als er overlijdensgegevens zijn, dan moeten in ieder geval het land en de datum opgenomen zijn. (dit mogen zogenaamde standaardwaarden zijn).', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (14, 'PRE010', 'Preconditie PRE001, specifiek voor de LO3-groep 08 Overlijden.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (15, 'PRE011', 'Als categorie 12 betrekking heeft op een Nederlands reisdocument, dan moeten in ieder geval 35.10 Soort NL reisdocument, 35.20 Nummer Nederlands reisdocument, 35.30 Datum uitgifte Nederlands reisdocument, 35.40 Autoriteit van afgifte Nederlands reisdocument en 35.50 Datum einde geldigheid Nederlands reisdocument opgenomen zijn. (dit mogen zogenaamde standaardwaarden zijn).', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (16, 'PRE012', 'Als er verblijfsrechtgegevens zijn, dan moeten in ieder geval 39.10 Aanduiding verblijfstitel en 39.30 Ingangsdatum verblijfstitel opgenomen zijn. (dit mogen zogenaamde standaardwaarden zijn)', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (17, 'PRE013', 'Buitenlands adres regel 4, Buitenlands adres regel 5 en Buitenlands adres regel 6 wordt gedurende de migratieperiode nog niet gebruikt, en zijn derhalve ook nooit gevuld.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (18, 'PRE014', 'Buitenlands adres regel 1, Buitenlands adres regel 2 en Buitenlands adres regel 3 bevatten gedurende de migratieperiode nooit meer dan 35 tekens.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (19, 'PRE017', 'Als er een actuele indicatie Bijzondere verblijfsrechtelijke positie is, dan moet tenminste 1 nationaliteit opgenomen zijn.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (20, 'PRE018', 'In een gevulde (niet lege) categorie Huwelijk/geregistreerd partnerschap (05 of 55) moet 05.15.10 Soort verbintenis opgenomen zijn. Er is in dit geval uitsluitend sprake van een lege categorie Huwelijk/geregistreerd partnerschap als de volgende groepen dan wel hun elementen ontbreken: 01,02,03,04,06,07,15.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (21, 'PRE019', 'Een afzonderlijke voornaam bevat geen spatie(s). Dit impliceert dat in het attribuut voornaam uit het Objecttype Persoon \ voornaam nooit een spatie kan voorkomen.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (22, 'PRE020', 'In een categorie-rij is nooit zowel groep 82 Document als een Groep 81 Akte opgenomen.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (23, 'PRE021', 'De combinatie van Voorvoegsel en Scheidingsteken (als deze geen spatie bevat) komt voor in GBA Tabel 36 Voorvoegselstabel. (Zie [GWB-BRP], Attribuuttype Voorvoegsel)  Als het Scheidingsteken een spatie bevat, komt het Voorvoegsel (dus zonder de spatie) voor in GBA Tabel 36.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (24, 'PRE022', 'Het voorvoegsel en scheidingsteken zijn beiden gevuld of beiden leeg.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (25, 'PRE023', 'Als 64.10 Reden verlies Nederlandse nationaliteit is gevuld, zijn 05.10 Nationaliteit en 63.10 Reden verkrijging Nederlandse nationaliteit niet gevuld.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (26, 'PRE024', 'Preconditie PRE001, specifiek voor de LO3-groep 06 Huwelijkssluiting.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (27, 'PRE025', 'Preconditie PRE002, specifiek voor de LO3-groep 03 Geboorte.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (28, 'PRE026', 'Preconditie PRE002, specifiek voor de LO3-groep 08 Overlijden.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (29, 'PRE027', 'Preconditie PRE002, specifiek voor de LO3-groep 06 Huwelijkssluiting.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (30, 'PRE028', 'Preconditie PRE001, specifiek voor de LO3-groep 07 Huwelijksontbinding.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (31, 'PRE029', 'Preconditie PRE002, specifiek voor de LO3-groep 07 Huwelijksontbinding.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (32, 'PRE030', 'Het element 85.10 Ingangsdatum geldigheid moet gevuld zijn (deze mag de standaardwaarde hebben of gedeeltelijk onbekend zijn).', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (33, 'PRE031', 'Het element 86.10 Datum van opneming moet gevuld zijn en mag geen standaardwaarde hebben en mag niet gedeeltelijk onbekend zijn, daar waar dit element in een categorie is gedefinieerd.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (34, 'PRE032', 'In een LO3-persoonslijst moet categorie 07 Inschrijving aanwezig zijn.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (35, 'PRE033', 'In een LO3-persoonslijst moet categorie 08 Verblijfplaats aanwezig zijn.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (36, 'PRE034', 'Voor iedere categorie-rij uit categorie 01/51 Persoon geldt dat de geslachtsnaam verplicht is.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (37, 'PRE035', 'Bij categorie 12 Reisdocument zijn altijd van precies één van de onderstaande groepen elementen ingevuld: <ul> <li>groep 35 Nederlands reisdocument</li> <li>groep 36 Signalering</li> <li>groep 37 Buitenlands reisdocument.</li> </ul>', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (38, 'PRE036', 'Gemeente van inschrijving en de datum waarop de inschrijving heeft plaatsgevonden moeten gevuld zijn. Dit betreffen de element 09.10 Gemeente van inschrijving en 09.20 Datum inschrijving uit categorie 08/58 Verblijfsadres.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (39, 'PRE037', 'Versienummer en Datum eerste inschrijving GBA moeten gevuld zijn. Dit betreft de elementen 80.10 Versienummer en 68.10 Datum eerste inschrijving GBA uit categorie 07 Inschrijving.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (40, 'PRE038', 'De Datumtijdstempel moet gevuld zijn. Dit betreft element 80.20 Datumtijdstempel uit categorie 07 Inschrijving', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (41, 'PRE039', 'Als bij een Huwelijk/geregistreerd partnerschap (categorie 05/55) gegevens uit de LO3-groep 01, 03 en/of 04 gevuld zijn, dan moet de Geslachtsnaam ook gevuld zijn.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (42, 'PRE040', 'Als er gegevens met betrekking tot de ontbinding zijn gevuld, dan mogen er geen gegevens met betrekking tot de sluiting zijn gevuld, en vice versa. Dit betekent dat de LO3-groepen 06 Huwelijkssluiting/aangaan geregistreerd partnerschap en 07 Ontbinding huwelijk/geregistreerd partnerschap niet in dezelfde categorie-rij mogen voorkomen.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (43, 'PRE041', 'Als er gegevens met betrekking tot de ontbinding of sluiting zijn gevuld, dan moet de geslachtsnaam ook gevuld zijn. Dit betekent dat als de LO3-groep 06 Huwelijkssluiting/aangaan geregistreerd partnerschap of 07 Ontbinding huwelijk/geregistreerd partnerschap voorkomt, dat ook het element 02.40 Geslachtsnaam echtgenoot/geregistreerd partner gevuld moet zijn.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (44, 'PRE042', 'Als 15.10 Soort verbintenis is gevuld, dan mag deze uitsluitend gevuld zijn met ‘H’ of ‘P’. NB: dit betekent dat ook de standaardwaarde ‘.’ niet wordt toegestaan.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (45, 'PRE043', 'In een BRP-persoonslijst is altijd een actuele geslachtsnaam opgenomen.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (46, 'PRE044', 'In een BRP-persoonslijst moeten actuele geboortegegevens opgenomen zijn.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (47, 'PRE045', 'In een BRP-persoonslijst moet een actuele Adres opgenomen zijn.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (48, 'PRE046', 'In een BRP-persoonslijst moet een actuele Administratienummer opgenomen zijn.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (49, 'PRE047', 'In een LO3-persoonslijst moet categorie 01 Persoon aanwezig zijn.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (50, 'PRE048', 'Als bij een Kind (categorie 09/59) gegevens uit de LO3-groep 01 en/of 03 gevuld zijn, dan moet de Geslachtsnaam ook gevuld zijn.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (51, 'PRE049', 'Als bij een Ouder (categorie 02/52 en categorie 03/53) gegevens uit de LO3-groep 01, 03, 04 en/of 62 gevuld zijn, dan moet de Geslachtsnaam ook gevuld zijn.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (52, 'PRE050', 'Als er een lege categorie-rij of het verlies van de Nederlandse nationaliteit voorkomt in een stapel (een actuele dan wel een historische categorie-rij), dan moet er ook een gevulde categorie-rij zijn, met 86.10 Datum van opneming die hetzelfde of ouder is en 85.10 Datum geldigheid die hetzelfde of ouder is. Categorie 02, 03, 05 en 06 vormen hierop een uitzondering.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (53, 'PRE051', 'Binnen één categorie 04 Nationaliteit-stapel komt altijd maar 1 nationaliteitcode voor, ook in de onjuiste categorie-rijen. Daarnaast mag de nationaliteitcode wel leeg zijn.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (55, 'PRE054', 'Als er gegevens aan de hand van een conversietabel vertaald moeten worden (denk bijvoorbeeld aan de codering van adellijke titels en predikaten), dan moet de desbetreffende waarde voorkomen in de conversietabel, of het gegeven moet niet ingevuld zijn.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (56, 'PRE055', 'De actuele categorie mag niet onjuist zijn.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (57, 'PRE056', 'Als er een lege categorie-rij is, moet de datum geldigheid van die categorie-rij ook voorkomen in een gevulde, onjuiste categorie-rij die een eerdere of gelijke datum van opneming heeft. Dit geldt voor de volgende categorieën: categorie 05/55 Huwelijk/geregistreerd partnerschap; categorie 06/56 Overlijden', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (58, 'PRE057', 'In geval van een Nederlands verblijfadres moet 11.70 Woonplaatsnaam een bestaande (actuele danwel historische) woonplaats zijn. Kortom het moet een in BAG voorkomende naam van een woonplaats bevatten. Dit betekent dat de letterlijke vulling van 11.70 Woonplaatsnaam moet voorkomen in de BRP stamtabel Plaats. Uitzondering hierop is de standaardwaarde ‘.’. Dit wordt behandeld als <geen waarde>', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (59, 'PRE058', 'Bij een persoon kunnen de volgende twee indicaties niet gelijktijdig geldig zijn: ''Vastgesteld niet Nederlander?'' en ''Behandeld als Nederlander''.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (60, 'PRE059', 'In de BRP mogen niet gelijktijdig twee ouders en een derde gezag hebben. Dit betekent dat de volgende drie attributen niet gelijktijdig de waarde ‘Ja’ mogen bevatten: <ul> <li>Ouder1 heeft gezag</li> <li>Ouder2 heeft gezag</li> <li>Derde heeft gezag</li> </ul>', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (61, 'PRE060', 'Een (actueel) A-nummer in categorie 01 mag niet voorkomen als actueel A-nummer op een andere persoonslijst. NB dit kan nu al niet voorkomen in de GBA-V.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (62, 'PRE061', 'Een (actueel) BSN in categorie 01 mag niet voorkomen als actueel BSN op een andere persoonslijst.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (63, 'PRE062', 'Bij een relatie naar een andere persoon (categorieën 02/52, 03/53, 05/55, 09/59) mogen het A-nummer en het BSN niet voorkomen als actueel A-nummer of actueel BSN op meer dan één (1) persoonslijst.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (64, 'PRE064', 'Voor categorie 02/52 Ouder1, 03/53 Ouder2, 05/55 Huwelijk/geregistreerd partnerschap en 09/59 Kind geldt dat als groep 02 voorkomt, dat geslachtsnaam verplicht is.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (65, 'PRE065', 'In een LO3-persoonslijst moet categorie 02 Ouder1 aanwezig zijn.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (66, 'PRE066', 'In een LO3-persoonslijst moet categorie 03 Ouder2 aanwezig zijn.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (67, 'PRE067', 'Datum document mag geen (gedeeltelijk) onbekend datum bevatten.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (68, 'PRE069', 'Als bij een Ouder (categorie 02/52 en categorie 03/53) de Geslachtsnaam gevuld is, dan moet ook 62.10 Datum ingang familierechtelijke betrekking gevuld zijn.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (69, 'PRE070', 'Als groep 82 Document is opgenomen, dan moeten zowel 82.10 Gemeente document, 82.20 Datum document als 82.30 Beschrijving document openomen zijn.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (70, 'PRE071', 'Als groep 81 Akte is opgenomen, dan moet zowel 81.10 Registergemeente akte als 81.20 Aktenummer gevuld zijn.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (71, 'PRE073', 'Op een persoonslijst moeten alle actuele kind categorieen (categorie 09) een verschillend A-nummer hebben.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (72, 'PRE074', 'Voor een huwelijk/geregistreerd partnerschap stapel (categorie 05/55) geldt dat twee elkaar opvolgende juiste voorkomens, waarbij 15.10 gelijk is en bij beiden groep 06 aanwezig is, alle elementen uit deze groep 06 gelijk moeten zijn.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (73, 'PRE075', 'Voor een huwelijk/geregistreerd partnerschap stapel (categorie 05/55) geldt dat twee elkaar opvolgende juiste voorkomens, waarbij 15.10 gelijk is en bij beiden groep 07 aanwezig is, alle elementen uit deze groep 07 gelijk moeten zijn.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (74, 'PRE076', 'Als 84.10 Indicatie onjuist dan wel strijdigheid met de openbare orde is gevuld, dan mag deze uitsluitend gevuld zijn met ‘O’ of ‘S’.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (75, 'PRE077', 'Als in categorie 07 het element 87.10 PK-gegevens volledig meegeconverteerd is gevuld, dan mag deze uitsluitend gevuld zijn met een ''P''.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (76, 'PRE078', 'Als 32.10 Indicatie gezag minderjarige gevuld is, dan mag deze uitsluitend één of een combinatie van de volgende tekens bevatten: ''1'', ''2'', ''D''.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (77, 'PRE079', 'Als in categorie 08/58 Verblijfplaats groep 14 voorkomt, dan moeten zowel 14.10 Land vanwaar gevestigd als 14.20 Datum vestiging in Nederland ingevuld zijn.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (78, 'PRE080', 'In Categorie 08/58 Verblijfplaats moet groep 10 voorkomen of moet groep 13 voorkomen.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (79, 'PRE081', 'Als in categorie 08/58 Verblijfplaats groep 13 voorkomt, dan moet 13.10 Land vanwaar vertrokken ingevuld zijn.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (80, 'PRE082', 'Er mogen geen nationaliteitstapels zijn die betrekking hebben op dezelfde nationaliteit. Dit betekent dat in de juiste voorkomens van de verschillen stapels niet dezelfde waarde in 05.10 Nationaliteit mag staan.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (81, 'PRE083', 'Als in categorie 04/54 Nationaliteit 63.10 Reden verkrijging Nederlandse nationaliteit gevuld is, dan moet 05.10 Nationaliteit ook gevuld zijn.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (82, 'PRE084', 'Als in categorie 08/58 Verblijfplaats groep 10 voorkomt, dan moet tevens 11.10 Straatnaam of 12.10 Locatieomschrijving ingevuld zijn.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (83, 'PRE085', 'Bij een Document is altijd precies één van de volgende twee attributen gevuld: Aktenummer of Omschrijving.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (84, 'PRE087', 'Als in categorie 07 groep 67 voorkomt, dan moeten zowel 67.10 Datum opschorting bijhouding als 67.20 Omschrijving reden opschorting bijhouding ingevuld zijn.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (85, 'PRE088', 'Als categorie 05/55 groep 06 voorkomt, dan moet 06.10 Datum Huwelijkssluiting/aangaan geregistreerd partnerschap ingevuld zijn.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (86, 'PRE089', 'Als in categorie 13 groep 38 voorkomt, dan moet 38.10 Aanduiding uitgesloten kiesrecht ingevuld zijn.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (87, 'PRE090', 'Als in categorie 13 groep 31 voorkomt, dan moet 31.10 Aanduiding Europees kiesrecht ingevuld zijn.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (88, 'PRE091', 'Als 11.50 Aanduiding bij huisnummer gevuld is, dan mag deze uitsluitend gevuld zijn met een van de volgende waarden: ‘by'' (= bij), ‘to’ (= tegenover).', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (90, 'PRE093', 'Er mag geen onjuist voorkomen zijn, die betrekking heeft op dezelfde nationaliteit als een juist dan wel onjuist voorkomen in een andere stapel. Dit betekent dat in de genoemde voorkomens niet dezelfde waarde in 05.10 Nationaliteit mag staan.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (92, 'AFN001', 'Afnemersindicaties: a-nummer is verplicht.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (93, 'AFN002', 'Afnemersindicaties: Er moet in minimaal 1 categorievoorkomen een afnemerindicatie gevuld zijn en alle gevulde afnemersindicaties in een stapel moeten gelijk zijn.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (94, 'AFN003', 'Afnemersindicaties: Ingangsdatum mag niet (gedeeltelijk) onbekend zijn.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (95, 'AUT001', 'Autorisaties: Afnemersindicatie is verplicht.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (96, 'AUT002', 'Autorisaties: Ingangsdatum mag niet (gedeeltelijk) onbekend zijn.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (97, 'AUT003', 'Autorisaties: Ingangsdatum is verplicht.', 2);
INSERT INTO VerConv.LO3SrtMelding (ID, Code, Oms, CategorieMelding) VALUES (98, 'AUT004', 'Autorisaties: Afnemersnaam is verplicht.', 2);
